import React from 'react';
import User from './User';

// Компоненты
class Users extends React.Component{

    constructor(props){
        super(props)
        this.state = {
            users: [
                {
                    id: 1,
                    firstname: "Alexey",
                    lastname: "Orlov",
                    bio: "Man",
                    age: 25,
                    isHappy: true
                },
                {
                    id: 2,
                    firstname: "Lera",
                    lastname: "Orlova",
                    bio: "Women",
                    age: 23,
                    isHappy: false
                }
            ]
        }
    }

	render () {
        if (this.state.users.length > 0 ){
            return(<div>
                {this.state.users.map((user) => (
                    <User/>
                ))}
            </div>)}
        else{
            return(<div className='user'>
                <h3>Пользователей нет!</h3>
            </div>)}
	}
}

export default Users;
